import React from 'react';

import MainButton from '../../components/main-btn/main-btn.component';

import './homepage.styles.scss';

const Homepage = () => {
  return(
    <div class="homepage-container">
      <h1 class="title">
        TO<span class="golden">D<i class="fas fa-fire fire"></i></span>S
      </h1>
      <h2 class="subtitle">
        THE <span class="golden bold">ULTIMATE</span> SOLUTION FOR AMAZING PERFORMANCE
      </h2>
      <MainButton />
    </div>
  )
}

export default Homepage;
